pages/lec01/01.html.body:
프로그램 언어의 이해



프로그램 언어란?
프로그램 언어의 구분




프로그램 언어란?

인간의 아름다운 언어로, 0과 1밖에 모르는 컴퓨터에게 자신의 할 일을 알려주기 위한 "인공언어".

프로그램 언어의 구분
- 처리수준에 따라 (운영체제와 얼마나 가까운가?)

기계어 ( Machine Language )
기계가 직접 이해할 수 있는 2진수의 언어

저급언어( Low-level Language )
어셈블리어 

고급언어( High-level Language )
C, C++, Java, C#등 



- 처리계에 따라 

인터프리터/스크립트 언어 : html, javascript, python 등 

컴파일러 언어 : C, Pascal, C++ 등 

컴파일 + 인터프리터 : Java, .NET 등



- 형태에 따라 

명령형 (절차형) 프로그래밍 언어 : C, Parscal 등  

객체지향 프로그래밍 언어 : C++, C#, Java 등 


- 문법에 따라 

BASIC 계열의 언어 : Visual Basic, VB Script, GW Basic 등 
Dim i
Set i = 10 
IF i > 10 Then 
WScript.Echo "10보다 작은 수입니다."
End


C계열의 언어 : Java, C++, C#, PHP, JavaScript 등 
C,C#,C++
int i = 10;
if(i > 10) {
printf("10보다 작은 수 입니다.");
}

JavaScript
var i = 10;
if(i > 10) {
console.out("10보다 작은 수 입니다.");
}

JAVA
int i = 10;
if(i > 10) {
console.out("10보다 작은 수 입니다.");
}

PHP
var $i = 10;
if($i > 10) {
echo("10보다 작은 수 입니다.");
}


혼합 : Pascal 등  
var 
 UserName : string; 
 Age: Integer;
begin 
 UserName := '이종석';
 Age := 20; 
end;

pages/lec01/03.html.body:
비주얼 스튜디오 2019 사용법

이번 강의는 VS2019를 이용하여 Win Console Application을 작성해보겠습니다.
나의 첫 C 프로그램 Hello World!!
  1) 비주얼 스튜디오에서 "파일" => "새로만들기" => "프로젝트" 를 선택합니다. 

  2) "프로젝트만들기" 대화창에서 "모든언어" 를 "C++" 로 변경하고 "빈프로젝트"를 선택하고 "다음"을 클릭합니다.

  3) 소스가 저장될 적당한 위치를 선택하고, "만들기"를 클릭합니다.

  4) 솔루션 탐색기 에서 "프로젝트"명에 마우스 오른쪽 버튼 클릭 후 "새 항목 추가"를 선택합니다.

  5) 항목 중 "C++ 파일 (.cpp)"를 선택하시고, 하단 파일명을 HelloWorld.c 로 변경 후 "추가" 버튼을 클릭합니다.

  6) "솔루션 탐색기" 의 "소스파일" 폴더를 열어 HelloWorld.c 파일을 열고 아래의 코드를 입력해 줍니다. 
  #include 

  int main() {
      printf("Hello World");
      return 0; 
  }

  7) 입력이 완료 되었으면 비주얼스튜디오 상단에 "로컬 윈도우스 디버거"를 클릭하여, 결과를 확인합니다. 

메인함수 (Main())의 다양한 종류
  IDE나 컴파일러를 만든 회사마다 다양한 방식의 main함수가 존재하지만, 일반적은 표준 C (Ansi C)에서는 아래의 3가지 방식을 추천한다.
  https://codeforwin.org/2017/08/various-declarations-main-function-c.html

int main(void) 
#include 

int main(void) {
  printf("Hello World");
  return 0; 
}


int main(int argc, char * argv[])
#include 

int main(int argc, char * argv[]) {
  printf("Hello World");
  return 0; 
}


int main(int argc, char ** argv)
#include 

int main(int argc, char ** argv) {
  printf("Hello World");
  return 0; 
}



메인함수를 통해 사용자의 입력 받기 ( int main(int argc, char ** argv)  )
  메인함수(main)의 소괄호 안에 있는 것들은 "변수"이며 우리는 이를 메인함수의 "인자"라고 부른다. 
  인자에 사용자 값을 받아서 출력하는 예제를 작성해 봅시다.
  #include 
  int main(int argc, char ** argv) {
      printf("입력값은 %s 입니다", argv[1]);
      return 0; 
  }

!) 이 예제를 실행하는 방법은 실습으로 배워보도록 하겠습니다. 
사용자 입력 받기 (scanf 함수)
  main 함수를 통해 인자를 받는게 아닌 Standard IO 의 scanf() 함수로 입력을 받아보도록 하겠습니다. 
  #include  

  int main() { //-- Application Starting Point 

    char name[30]; 

    printf("이름이 무엇인가요? : ");
    scanf("%d", name); 
    printf("안녕하세요? %s님!!!", name);

  }

위의 코드는 비주얼 스튜디오에서 컴파일 에러를 발생시킵니다.   
표준함수인 scanf()가 비주얼스튜디오에선 보안이슈로 depricated 되었기 때문입니다.
따라서 scanf() 함수를 scanf_s()로 변경하거나.    
#define _CRT_SECURE_NO_WARNINGS 를 삽입하는 방식으로 해결하도록 합니다. 
   - scanf_s 사용
    #include  

    int main() {

        char name[10];  
        printf("문자열을 입력하세요: ");
        scanf_s("%s", name, 10);
        printf("%s\n", name);
        return 0;

    }

   - _CRT_SECURE_NO_WARNINGS 사용
    #ifdef _MSC_VER
    #define _CRT_SECURE_NO_WARNINGS
    #endif

    #include  

    int main() {

        char name[10];  
        printf("문자열을 입력하세요: ");
        scanf("%s", name);
        printf("%s\n", name);
        return 0;

    }

visual studio로 디버깅
!) 실습 입니다 ^^

pages/lec02/01.html.body:
C언어의 서식지정자 (Format Specifiers)



정수 (%d) 출력
10진수, 8진수, 16진수 출력 (%d, %o, %x)
실수(%d) 출력
문자(%c)와 문자열(%s) 출력
소수의 과학표기법
서식시정자의 플래그, 폭, 정밀도, 특별표시문자 옵션
% 출력하기




"서식 지정자"는 컴퓨터가 어떤정보를 어떻게 해석할지 결정해주는 것을 말합니다.예를 들어 정수 10은 10진수로 해석하면 10이지만, 8진수는 012, 16진수로 해석하면 0xA,ASCII로 해석하면 \n(new line)이 됩니다.   

정수 (%d) 출력
#include 

int main() {
    printf("%d + %d = %d \n", 10, 5, 10+5);
    return 0; 
}

10진수, 8진수, 16진수 출력 (%d, %o, %x)
#include 

int main() {
    printf("10진수 %d는 8진수로는 %o이고 16진수로는 %x입니다 \n", 10, 10, 10);
    return 0; 
}

실수(%d) 출력
#include 

int main() {
  printf("실수 출력: %f \n", 0.5); 
  printf("6자리 실수 출력 : %f \n", 0.123456);
  printf("실수를 정수로 출력 : %d \n", 0.5);
  return 0; 
}

문자(%c)와 문자열(%s) 출력
#include 

int main() {
    printf("a의 대문자 : %c \n", 'A');
    printf("a의 대문자 : %c \n", 65);
    printf("%s %c 입니다. \n", "a의 대문자", 'A'); 
    return 0;
}

소수의 과학표기법
#include 

int main() {
    printf("%f \n", 0.000123);
    printf("%f \n", 0.0001236);
    printf("%e \n", 0.000123);
    printf("%E \n", 0.0001236);
    return 0;
}

서식시정자의 플래그, 폭, 정밀도, 특별표시문자 옵션

폭 

#include 

int main() {
    printf("|%10d|\n", 20);
    printf("|%010d|\n", 20);
    return 0;
}


우측정렬(+)과 좌측 정렬(-)

#include 

int main() {
    printf("|%6d|\n", 20);
    printf("|%+6d|\n", 20);
    printf("|%-6d|\n", 20);
    return 0;
}


정밀도 

#include 

int main() {
    printf("|%.6d| \n", 20);
    printf("|%.3f| \n", 0.123556);
    printf("|%.10f| \n", 0.123556);
    printf("|%010f| \n", 0.123556);
    return 0;
}


특별표시문자 

#include 

int main() {
    printf("%o\n", 0721);  
    printf("%x\n", 0xf1);   
    printf("====================\n"); 
    printf("%#o\n", 0721);  // 8진수이면 앞에 0을 붙임
    printf("%#x\n", 0xf1);  // 16진수 소문자 출력이면 앞에 0x를 붙임
    return 0;
}

% 출력하기
#include 

int main() {
    printf("경재성장률은 %d %% 입니다.", 10);
    return 0;
}

pages/lec02/02.html.body:
이스케이프 시퀀스 (Escape Sequence)



이스케이프 시퀀스의 종류
예제




이스케이프 시퀀스란, "\"와 특정문자를 결합하여, C언어 특성상 표햔할 수 없는 기능이나 문자를 표시해주는 방법입니다. 
이스케이프 시퀀스의 종류

예제
#include 

void main() {

    printf("\a"); //-- 비프음

    printf("Hello World!\n"); //-- 뉴라인 
    printf("Hello World!\b"); //-- 백스페이스 
    printf("Hello World!\nHello World!\r"); //-- 뉴라인, 케리지리턴
    printf("\tHello World!\tHello World!\n"); //-- 탭
    printf("Hello World!\\Hello World!\n"); //-- / 출력

    printf("\"Hello World!\",\'Hello World!\'\n"); //-- ",' 출력 
    printf("'Hello World!'\n"); //-- ",' 출력 

    // ASCII 문자 표현 (8진수/16진수)
    printf("a의 대문자 \101\n");
    printf("a의 대문자 \x41\n");

    return 0;

}

