pages/lec02/04.html.body:
자료형의 크기



자료형의 데이터 크기 확인 (Bytes)
자료형의 최소/최대값




자료형의 데이터 크기 확인 (Bytes)
#include

int main(void)
{       
  // 정수형 
  char num1 = 10;
  short num2 = 20;
  int num3 = 30;
  long num4 = 40;

  // 실수형
  float num5 = 3.14;
  double num6 = 3.15;
  long double num7 = 3.17;

  printf("\n-------정수형 자료형과 변수의 메모리 크기-------\n");
  printf("char형의 크기: %d바이트, %d바이트 \n", sizeof(char), sizeof(num1));
  printf("short형의 크기: %d바이트, %d바이트 \n", sizeof(short), sizeof(num2));
  printf("int형의 크기: %d바이트, %d바이트 \n", sizeof(int), sizeof(num3));
  printf("long형의 크기: %d바이트, %d바이트 \n", sizeof(long), sizeof(num4));

  printf("\n-------실수형 자료형과 변수의 메모리 크기-------\n");
  printf("float형의 크기: %d바이트, %u바이트 \n", sizeof(float), sizeof(num5));
  printf("double형의 크기: %d바이트, %d바이트 \n", sizeof(double), sizeof(num6));
  printf("long double형의 크기: %d바이트, %d바이트 \n", sizeof(long double), sizeof(num7));

  return 0;
}

자료형의 최소/최대값
#include 
#include 
#include 

int main(void)
{

    //-- 정수형 
    printf("char의 최소값은 %d, 최대값은 %d \n", CHAR_MIN, UCHAR_MAX);
    printf("short의 최소값은 %d, 최대값은 %d \n", SHRT_MIN, SHRT_MAX);
    printf("int의 최소값은 %d, 최대값은 %d \n", INT_MIN, INT_MAX);
    printf("long의 최소값은 %ld, 최대값은 %ld \n", LONG_MIN, LONG_MAX);

    printf("unsigned short의 최소값은 %d, 최대값은 %u \n", 0, USHRT_MAX);
    printf("unsigned short의 최소값은 %d, 최대값은 %u \n", 0, USHRT_MAX);
    printf("unsigned int의 최소값은 %d, 최대값은 %u \n", 0, UINT_MAX);
    printf("unsigned long의 최소값은 %d, 최대값은 %u \n", 0, ULONG_MAX);

    //-- 실수형 
    printf("float 최소값은 %.3e, 최대값은 %.3e \n", FLT_MIN, FLT_MAX);
    printf("double 최소값은 %.3e, 최대값은 %.3e \n", DBL_MIN, DBL_MAX);
    printf("long double 최소값은 %.3e, 최대값은 %.3e \n", LDBL_MIN, LDBL_MAX);

    return 0;
}

pages/lec02/05.html.body:
변수(Variables)


정수형 변수 선언 및 사용 

#include 

int main() {

    int a = 0;
    int b = 10; 
    int c = a + b; 

    printf("a의 값은 %d입니다. \n", a);
    printf("b의 값은 %d입니다. \n", b);
    printf("c의 값은 %d입니다. \n", c);

    printf("\n\n"); 

    a = a + 3; 
    b = 15;
    c = a - b; 

    printf("변경된 a의 값은 %d입니다. \n", a);
    printf("변경된 b의 값은 %d입니다. \n", b);
    printf("변경된 c의 값은 %d입니다. \n", c);


    return 0; 
}


실수형 변수 선언 및 사용 

#include 

int main() {

  float a = 0.2f; 
  float b = 1.3f; 
  float c = a + b;

  printf("a의 값은 %f입니다. \n", a);
  printf("b의 값은 %f입니다. \n", b);
  printf("c의 값은 %f입니다. \n", c);

  printf("\n\n");

  a = a + 3.0f;
  b = b + 7.9f;
  c = a + b;

  printf("변경된 a의 값은 %f입니다. \n", a);
  printf("변경된 b의 값은 %f입니다. \n", b);
  printf("변경된 c의 값은 %f입니다. \n", c);

  return 0;
}


문자형 변수 선언 및 사용 

#include

int main()
{
  char a = 'A'; 
  char b = 'B'; 
  char c = 'a'; 
  char d = '!'; 
  char e = '@';
  char f = '#'; 

  printf("변수 a의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", a, a); 
  printf("변수 b의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", b, b); 
  printf("변수 c의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", c, c); 
  printf("변수 d의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", d, d); 
  printf("변수 e의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", e, e); 
  printf("변수 f의 ASCII 코드값은 %d이고 문자 %c를 뜻합니다. \n", f, f); 

  return 0;
}

pages/lec02/06.html.body:
상수 (Constants)



리터럴(Liternal) 상수
심볼릭(Symbolic) 상수
메크로(Macro) 상수




리터럴(Liternal) 상수
  "문자 그대로"라는 뜻으로, 값 그자체를 뜻합니다.  리터럴 상수는 변수와는 달리 데이터가 저장된 메모리 공간을 가르키는 "이름"이 없습니다. 
  잠깐 사용되고 메모리에서 바로 해제됩니다. 
#include

int main(void)
{

  //-- 정수형 리터럴 상수 
  printf("10진수 정수형 상수 %d + %d = %d입니다. \n", 10, 20, 10 + 20);
  printf("16진수 정수형 상수 %x + %x = %x입니다.(10진수로는 %d) \n ", 0x10, 0x20, 0x10 + 0x20, 0x10 + 0x20);
  printf("8진수 정수형 상수 %o + %o = %o입니다.(10진수로는 %d) \n" , 010, 020, 010 + 020, 010 + 020);

  //-- 실수형 리터럴 상수 
  printf("실수형 상수 %f + %f = %f입니다. \n", 3.1, 4.1, 3.1 + 4.1);

  //-- 문자형 리터럴 상수 
  printf("문자 상수 %c %c %c입니다. \n", ’a’, ’b’, ’c’); 
  printf("문자 상수 %c %c %c입니다. \n", ’!’, ’@’, ’#’);

  //-- 문자열 리터럴 상수 
  printf("문자열 상수는 %s입니다. \n", "A");
  printf("문자열 상수는 %s입니다. \n", "10 + 10");
  printf("문자열 상수는 %s입니다. \n", "Hi, everyone.");


  return 0;
}

심볼릭(Symbolic) 상수
  변수와 마찬가지로 "상수명"이 있으며, 따라서 상수명을 통한 접근이 가능하며, const 키워드를 사용합니다.
  문법은 const [데이터형] [변수명]; 입니다. 
#include

int main(void)
{

  const float pi = 3.14f; 
  int radius = 100; 

  // pi = 3.15f // 에러발생 

  printf("원의 반지름은 %f 이고, \n", radius);
