#include 

void hello(int count)
{
    if (count == 0)    
        return;

    printf("Hello, world! %d\n", count);

    hello(--count);    
}

int main()
{
    hello(5);    
    return 0;
}

펙토리얼 (Factorial) 구현
!) 팩토리얼은 1부터 ~ n까지의 숫자를 차례대로 곱한 값이며 !로 표시한다.
   ex) 5! = 5 * 4 * 3 * 2 * 1 = 120 
#include 

int factorial(int n)
{
    if (n == 1)      
        return 1;    

    return n * factorial(n - 1);   
}

int main()
{
    printf("%d", factorial(5));

    return 0;
}

