r
파일을 읽기 형식으로 연다. 이 때, 파일은 반드시 존재해야 한다


w
파일을 쓰기 형식으로 연다. 만일 동일한 파일이 이미 존재하고 있다면  그 파일의 내용은 모두 지워진 후 새롭게 생긴 빈 파일로 간주하며,  파일이 존재하고 있지 않는다면 빈 파일을 새롭게 생성한다.


a
파일을 덧붙이기(append) 형식으로 연다.  쓰기 작업은 파일 끝에 데이타를 덧붙일 것이다.  만일 파일이 존재하지 않는다면 새로 생성된다.


r+
파일을 읽기 및 쓰기 형식으로 연다.  이 때, 파일은 반드시 존재해야 한다.


w+
파일을 읽기 및 쓰기 형식으로 연다.  만일 동일한 파일이 이미 존재하고 있다면 그 파일의 내용은 모두 지워진 후 새롭게 생긴 빈 파일로 간주하며,  파일이 존재하고 있지 않다면 빈 파일을 새로 생성하게 된다.


a+
파일을 읽기 및 덧붙이기(append) 형식으로 연다.  지정한 파일이 존재하지 않는다면 새롭게 생성된다.  모든 쓰기 작업은 파일의 맨 끝에서 진행되며 기존의 파일 내용들에 덮혀씌여지지 않는다.



