#include

int main(void)
{ 
    char c = 'A';
    char* cp = NULL;

    cp = &c;

    printf("%p %p %p\n", &c, cp, &cp);
    printf("%c %c\n", c, *cp);

    *cp = 101;
    printf("%c %c\n", c, *cp);

    return 0;
}

역참조 연산자
#include 

int main() {
    int *np; 
