배열과 포인터의 차이 

포인터는 변수이지만, 배열은 상수이다.  
배열의 그 크기 대문에 함수의 인자로 전달될 수 없다 (C언어), 따라서 배열을 전달할 경우 포인터로 전달한다.  
배열보다 포인터의 연산속도가 약 2배가량 빠르다.( *p 는 p가 가르치는 주소값을 바로 접근하지만 arr[n]의 경우에는 현재 번지수에서 n을 더한후 읽어야 함으로 느리다. )   



배열의 주소값 확인
#include

int main(void)
{
    int array[3] = {10, 20, 30};

    printf("%p %p %p\n", array, array + 0, &array[0]);
    printf("%p %p\n", array + 1, &array[1]);
    printf("%p %p\n", array + 2, &array[2]);

    printf("%u %u %u\n", sizeof(array), sizeof(array + 0), sizeof(&array[0]));

    return 0;
}

배열이름(시작 cursor)를 이용한 주소연산
#include

int main()
{
    int array[3] = {10, 20, 30};

    printf("%d %d %d %d\n", *array, *(array + 0), *&array[0], array[0]);
    printf("%d %d %d\n", *(array + 1), *&array[1], array[1]);
    printf("%d %d %d\n", *(array + 2), *&array[2], array[2]);

    printf("%u %u %u %u\n", sizeof(*array), sizeof(*(array + 0)), sizeof(*&array[0]), sizeof(array[0]));

    return 0;
}

배열과 포인터 변수
#include

int main()
{
    int array[3] = {10, 20, 30};
    int* p = NULL;

    p = array;

    printf("%p %p %p\n", p, p + 0, &p[0]);
    printf("%p %p\n", p + 1, &p[1]);
    printf("%p %p\n", p + 2, &p[2]);

    return 0;
}

#include

int main()
{
    int array[3] = {10, 20, 30};
    int* p = NULL;

    p = array;

    printf("%d %d %d\n", *p, *(p + 0), *&p[0]);
    printf("%d %d\n", *(p + 1), *&p[1]);
    printf("%d %d\n", *(p + 2), *&p[2]);

    return 0;
}

포인터의 크기와 배열의 크기
#include

int main(void)
{
    int array[3] = {10, 20, 30};
    int* p = NULL;

    p = array;

    printf("%d %d %d\n", array[0], array[1], array[2]);
    printf("%d %d %d\n", *(array + 0), *(array + 1), *(array + 2));
    printf("%d %d %d\n", p[0], p[1], p[2]);
    printf("%d %d %d\n", *(p + 0), *(p + 1), *(p + 2));

    printf("배열의 크기 : %u  포인터의 크기 : %u\n", sizeof(array), sizeof(p));

    return 0;
}

주소의 가감산을 이용한 배열 접근
#include

int main(void)
{
    int array[3] = {10, 20, 30};
    int* p = NULL;

    p = array;
    printf("%d %d %d\n", p[0], p[1], p[2]);
    printf("%d %d %d\n", *(p + 0), *(p + 1), *(p + 2)); // *(p + 0) == *p

    printf("\n");

    p = array + 1;
    printf("%d %d %d\n", p[-1], p[0], p[1]);
    printf("%d %d %d\n", *(p - 1), *(p + 0), *(p + 1));

    printf("\n");


    return 0;
}

포인터 연산을 이용한 배열 접근
#include

int main(void)
{
    int array[3] = {1,2,3};
    int *p = NULL;

    p = array;
    printf("%d %d %d\n", array[0], array[1], array[2]); 

    *p++ = 10; // *p = 10; p = p + 1;
    printf("%d %d %d\n", array[0], array[1], array[2]);

    *p++ = 20; // *p = 20; p = p + 1;
    printf("%d %d %d\n", array[0], array[1], array[2]);

    *p = 30;
    printf("%d %d %d\n", array[0], array[1], array[2]);

    return 0;
}

